import React, {Component} from "react";
import Testimonial from "./Testimonial.js";

const Opinia_1 = {
    image : './img/girl1.jpg',
    name : 'Ania',
    rating : 5,
    testimonial_text : 'Najlepsze wyjazdy, cudowni ludzie, niepowtarzalne wspomnienia!'
};

const Opinia_2 = {
    picture : './img/man1.jpg',
    name : 'Jacek',
    rating : 4,
    testimonial_text : 'Wszystko ok!'
};

const Opinia_3 = {
    picture : './img/man2.jpg',
    name : 'Robert',
    rating : 3,
    testimonial_text : 'Autokar smierdzial i dlatego 3!'
};

let Testimonials_Arr = [Opinia_1, Opinia_2, Opinia_3];

class TestiWrapper extends Component {
    render () {
        return (
            <div>
                <div>
                    {Testimonials_Arr.map((el) =>
                        <Testimonial image={el.image} name={el.name} rating={el.rating} text={el.testimonial_text}/>
                    )}
                </div>
            </div>
        )

    }
}

export default TestiWrapper;
